const Jobs = () => {
  return (
    <div className="py-10 px-6 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">All Jobs</h1>
      <p className="text-gray-600 mb-4">
        This page will display all available jobs with advanced filtering options.
      </p>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Job listings will appear here */}
      </div>
    </div>
  );
};

export default Jobs;
